import React from "react";

class Forms extends React.Component {
  render() {
    return (
      <div className='form'>
      <h1>Meu formulário</h1>
      <label>
        Quem é você?
        <select name='quemSouEu'>
          <option value='Nsei'>Não Sei</option>
          <option value='seiLa'>Sei lá</option>
        </select>
      </label>
      <label>Descreva a existência
        <input type='text' name='exists'/>
      </label>

      </div>
    )
  }
}

export default Forms;
